import React from "react";
import Movie from "./movie";
import { moviesContext } from "../context/moviesContext";

function MoviesList(props) {
  return (
    <moviesContext.Consumer>
      <React.Fragment>
        <div>{(context) => <p>{context.value}</p>}</div>
      </React.Fragment>
    </moviesContext.Consumer>
  );
}

export default MoviesList;
